import React from 'react';
import { Route, Router } from 'react-router';
import './App.css';

import Home from './containers/Home';

function App() {
  return (
    <div className="App">
      <header className="App-header">

      </header>
      <main>
        <Router>
          <Route path="/" exact component={Home} />
        </Router>

      </main>
    </div>
  );
}

export default App;
